import { createWebHistory, createRouter } from 'vue-router'
import Home from '../components/views/Home';
import UserList from '../components/views/UserList';
import CareerList from '../components/views/CareerList';
import Swiper from '../components/views/Swiper';

//우리가 사용할 route 생성 및 설정
const routes = [
  {
    path: '/',
    name: 'Home',
    component: Home,
  },
  {
    path: '/career',
    name: 'career',
    component: Career, 
  },
  {
    path: '/userlist',
    name: 'userlist',
    component: UserList, 
  },
  {
    path: '/swiper',
    name: 'swiper',
    component: Swiper, 
  },
];

const router = createRouter({
    history: createWebHistory(),
    routes
})

export default router
